import React from 'react';

const Card = () => {
    const API_URL = `http://aleksanderblaszkiewicz.pl/kiedykolos/get_courses.php`;
    const [courses, setCourses] = useState([]);

    useEffect(() => {
        getCourses();
    }, []);

    const getCourses = async () => {
        const response = await fetch(API_URL);
        const data = await response.json();
        setCourses(data);
        console.log(courses);
    }
    return(
        <>
            <h1>Przedmioty: </h1>
            {courses.map(course => (
                <p>Przedmiot: {course.name}</p>
            ))}
            
        </>
    )
}

export default Card;
